import { Home } from "./Pages/Home";
import {BrowserRouter,Route} from "react-router-dom"
import Profile from "./Pages/Profile";

function App() {
  return (
      <>
      <BrowserRouter>
      <Route path="/" Component={<Home/>}/>
      <Route path="/profile" Component={<Profile/>}/>

      </BrowserRouter>
      </>
  );
}

export default App;
